import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import 'tachyons';

const SubStyle = 
{
  color: "#fec503"
}


class BreastCancer extends Component {
  constructor(props) {
    super(props);
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(selectorFiles) {
    console.log(selectorFiles);
  }
  render() {
    return (
      <div className="tc">
        <h1 className="tc f1 lh-title" style={SubStyle}>
          BREAST CANCER
        </h1>
        <div className="dib col-xl-8 col-sm-10 mb-10">
          <Link to="#">
            <div className="bg-white rounded shadow-sm py-5 px-4 tc ma4-ns">
              <h1 className="mb-0">
                <input
                  type="file"
                  onChange={e => this.handleChange(e.target.files)}
                />
              </h1>
            </div>
          </Link>
          <h1 className="mb-0">
            <button type>Generate Report</button>
          </h1>
        </div>
      </div>
    );
  }
}

export default BreastCancer;
